import React from 'react';
import { useData } from '../../Context/DataContext';
import { useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus, faEdit, faTrash, faLaptop } from '@fortawesome/free-solid-svg-icons';
import '../../App.css';
const Equipment = () => {
  const navigate = useNavigate();
  const { equipment, setEquipment } = useData();

  const handleDelete = (id) => {
    if (window.confirm("Are you sure you want to delete this equipment?")) {
      setEquipment(equipment.filter(item => item.id_materiel !== id));
    }
  };

  return (
    <div className="equipment-container">
      <div className="equipment-header">
        <h1 className="equipment-title">Equipment Management</h1>
        <div className="header-actions">
          <button 
            onClick={() => navigate('/equipment/add')} 
            className="btn btn-add-equipment"
          >
            <FontAwesomeIcon icon={faPlus} /> Add New Equipment
          </button>
        </div>
      </div>

      <div className="equipment-table-wrapper">
        {equipment.length === 0 ? (
          <div className="no-equipment">
            <p>No equipment found. Add your first equipment to get started.</p>
            <button 
              onClick={() => navigate('/equipment/add')} 
              className="btn btn-add-equipment"
            >
              <FontAwesomeIcon icon={faPlus} /> Add Equipment
            </button>
          </div>
        ) : (
          <table className="equipment-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Type</th>
                <th>Brand</th>
                <th>Model</th>
                <th>Status</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {equipment.map((item) => (
                <tr key={item.id_materiel}>
                  <td>{item.id_materiel}</td>
                  <td>{item.type_materiel}</td>
                  <td>{item.marque}</td>
                  <td>{item.modele}</td>
                  <td>
                    <span className={`status-badge status-${item.etat.toLowerCase().replace('Ã©', 'e')}`}>
                      {item.etat}
                    </span>
                  </td>
                  <td className="equipment-actions">
                    <button 
                      onClick={() => navigate(`/equipment/edit/${item.id_materiel}`)}
                      className="btn btn-edit"
                      title="Edit equipment"
                    >
                      <FontAwesomeIcon icon={faEdit} />
                    </button>
                    <button 
                      onClick={() => handleDelete(item.id_materiel)}
                      className="btn btn-delete"
                      title="Delete equipment"
                    >
                      <FontAwesomeIcon icon={faTrash} />
                    </button>
                    <button 
                      onClick={() => navigate(`/attribution/assign?equipmentId=${item.id_materiel}`)}
                      className="btn btn-assign"
                      title="Assign to employee"
                    >
                      <FontAwesomeIcon icon={faLaptop} />
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default Equipment;
